import styled from 'styled-components';

export const Container = styled.header`
  img {
    height: 20px;
    width: 16px;
  }
  img {
    height: 20px;
    width: 16px;
  }
  a {
    color: ${({ theme }) => theme.colors.primary.main};
  }
`;
